import React, { useState } from "react";
import axios from "axios";
import { useNavigate } from "react-router-dom";
import AdminHeader from "../AdminHeader";
import { Upload, XCircle, Plus } from "lucide-react";

export default function AddProduct() {
  const navigate = useNavigate();
  const token = localStorage.getItem("adminToken");

  const [form, setForm] = useState({
    name: "",
    brand: "",
    price: "",
    quantityInStock: "",
    screenSize: "",
    ram: "",
    storage: "",
    chipset: "",
    camera: "",
    battery: "",
    os: "",
    color: "",
    description: "",
  });

  const [images, setImages] = useState([]);
  const [preview, setPreview] = useState([]);

  const handleChange = (e) => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  const handleImageUpload = (e) => {
    const files = Array.from(e.target.files);
    setImages([...images, ...files]);
    const previewUrls = files.map((file) => URL.createObjectURL(file));
    setPreview([...preview, ...previewUrls]);
  };

  const removeImage = (index) => {
    const newImgs = [...images];
    const newPrev = [...preview];
    newImgs.splice(index, 1);
    newPrev.splice(index, 1);
    setImages(newImgs);
    setPreview(newPrev);
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    const data = new FormData();
    Object.keys(form).forEach((key) => data.append(key, form[key]));
    images.forEach((img) => data.append("images", img));

    try {
      await axios.post(
        "http://localhost:8080/api/admin/products",
        data,
        {
          headers: {
            Authorization: `Bearer ${token}`,
            "Content-Type": "multipart/form-data",
          },
        }
      );
      alert("Thêm sản phẩm thành công!");
      navigate("/admin/products");
    } catch (error) {
      alert("Lỗi khi thêm sản phẩm!");
      console.error(error);
    }
  };

  return (
    <>
      <AdminHeader />

      <div style={{ height: 70 }}></div>

      <div style={styles.wrapper}>
        <h2 style={styles.pageTitle}>Thêm sản phẩm mới</h2>

        <form onSubmit={handleSubmit} style={styles.formContainer}>
          {/* LEFT */}
          <div style={styles.leftCol}>
            {/* ... giữ y style và form như bạn có ... */}
          </div>

          {/* RIGHT */}
          <div style={styles.rightCol}>
            {/* ... giữ nguyên giống code cũ ... */}
          </div>
        </form>
      </div>
    </>
  );
}



const styles = {
  wrapper: { maxWidth: 1350, margin: "auto", padding: 20 },
  pageTitle: { fontSize: 26, fontWeight: 600, marginBottom: 20 },
  formContainer: { display: "flex", gap: 25, alignItems: "flex-start" },
  leftCol: { flex: 2, display: "flex", flexDirection: "column", gap: 20 },
  rightCol: { flex: 1.2, display: "flex", flexDirection: "column", gap: 20 },
  card: { background: "#fff", padding: 20, borderRadius: 10, border: "1px solid #eee" },
  cardTitle: { fontSize: 18, fontWeight: 600, marginBottom: 15 },
  label: { fontWeight: 600, fontSize: 14, marginBottom: 6 },
  input: { width: "100%", padding: "10px 12px", borderRadius: 6, border: "1px solid #ccc", marginBottom: 15 },
  textarea: { width: "100%", minHeight: 120, padding: "10px 12px", borderRadius: 6, border: "1px solid #ccc", marginBottom: 15 },
  uploadLabel: { padding: "10px 12px", border: "1px dashed #aaa", borderRadius: 6, display: "inline-flex", gap: 8, cursor: "pointer", color: "#555", marginBottom: 15 },
  previewContainer: { display: "flex", gap: 12, flexWrap: "wrap" },
  previewBox: { position: "relative", width: 100, height: 100, borderRadius: 6, overflow: "hidden", border: "1px solid #ddd" },
  previewImg: { width: "100%", height: "100%", objectFit: "cover" },
  removeImg: { position: "absolute", top: 4, right: 4, background: "transparent", border: "none", cursor: "pointer" },
  submitBtn: { background: "#ee4d2d", marginTop: 10, color: "#fff", padding: "12px 18px", borderRadius: 6, border: "none", cursor: "pointer", fontSize: 15, display: "flex", gap: 6, alignItems: "center", justifyContent: "center" },
};
